import React from "react";
import ImageTwo from "../images/landingpic.jpg";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <>
      <img
        src={ImageTwo}
        alt="enfamil"
        className="h-full rounded mb-50 shadow"
      />
      {/* Flex container */}
      <section className="relative">
        <div className="container flex flex-col-reverse lg:flex-row items-center gap-12 mt-14 lg:mt-28">
          <div className="flex flex-1 flex-col items-center lg:items-start">
            <h2
              className="text-bookmark-blue text-3xl md:text-4 lg:text-5xl text-center lg:text-left
mb-6"
            >
              Looking for formula? Start with our store locator.{" "}
            </h2>
            <Link>
              Find Formula{" "}
              <svg
                xmlns="http://www.w3.org/2000/svg"
                className="h-6 w-6"
                fill="none"
                viewBox="0 0 24 24"
                stroke="currentColor"
                strokeWidth={2}
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z"
                />
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  d="M15 11a3 3 0 11-6 0 3 3 0 016 0z"
                />
              </svg>
            </Link>
          </div>
        </div>
      </section>
    </>
  );
};

export default Home;
